  stage: ValidationStage,
  filePath: string,
  error: unknown,
  toolName?: string
): ValidationResult {
  const message = `Custom tool validation failed at ${stage}.`;
  const detail = error instanceof Error ? error.message : String(error);
  return {
    success: false,
    file_path: filePath,
    tool_name: toolName,
    stage,
    message,
    error: detail,
